import com.home.shine.bytes.BytesReadStream;

/** (generated by shine) */
public class SendHttpClientLogHttpResponse extends LoginHttpResponse
{
	/** 数据类型ID */
	public static final int dataID=LoginHttpResponseType.SendHttpClientLog;
	
	/** uid */
	public String uid="";
	
	/** 类型 */
	public int type;
	
	/** 内容 */
	public String content="";
	
	public SendHttpClientLogHttpResponse()
	{
		_dataID=LoginHttpResponseType.SendHttpClientLog;
	}
	
	/** 执行 */
	@Override
	protected void execute()
	{
		LoginC.main.onClientLog(uid,type,content);
		result(true);
	}
	
	/** 读取字节流(完整版) */
	@Override
	protected void toReadBytesFull(BytesReadStream stream)
	{
		super.toReadBytesFull(stream);
		
		stream.startReadObj();
		
		this.uid=stream.readUTF();
		
		this.type=stream.readInt();
		
		this.content=stream.readUTF();
		
		stream.endReadObj();
	}
	
	/** 读取字节流(简版) */
	@Override
	protected void toReadBytesSimple(BytesReadStream stream)
	{
		super.toReadBytesSimple(stream);
		
		this.uid=stream.readUTF();
		
		this.type=stream.readInt();
		
		this.content=stream.readUTF();
		
	}
	
}
